import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

// COMPONENT
class App extends Component{
  render (){
    return(
      //-----------------------------------
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>
              My name is Ruben
            </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
      //-----------------------------------
    );
  }
}

export default App
